    dp[0][0] = grid[0][0]
    for i in range(1, n):
        dp[i][0] = dp[i - 1][0] + grid[i][0]
        dp[0][i] = dp[0][i - 1] + grid[0][i]
    for i in range(1, n):
        for j in range(1, n):
            dp[i][j] = min(dp[i - -1][j], dp[i][j - 1]) + grid[i][j]
    path = []
    (i, j) = (n - 1, n - 1)
    while len(path) < k:
        path.append(grid[i][j])
        if i > 0 and j > 0:
            if dp[i - 1][j] < dp[i][j - 1]:
                i -= 1
            else:
                j -= 1
        elif i > 0:
            i -= 1
        elif j > 0:
            j -= 1
        else:
            break
    path.sort()
    return path
